import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App";
import { BrowserRouter as Router, Routes, Route, Form } from "react-router-dom";
import Home from "../src/components/page/Home/Home";
import "./index.css";
import "./index.css";
import WasteClassification from "./components/page/WasteClassification/WasteClassification";
import TrashCatchGame from "./components/TrashCatchGame/TrashCatchGame";
import Contact from "./components/page/Contact/Contact";
import About from "./components/page/About/About";
import MainContent from "./components/page/RecyclingGuide/MainContent";
import Login from "./components/page/Login/Login";
import Register from "./components/page/Register/Register";
import Profile from "./components/page/Profile/Profile";
import BlogList from "./components/page/Blog/BlogList";
import BlogDetail from "./components/page/Blog/BlogDetail";
import CreateBlog from "./components/page/Blog/CreateBlog";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <Router>
      <App>
        <Routes>
          <Route index path="/" element={<Home />} />
        </Routes>
        <Routes>
          <Route index path="/classify" element={<WasteClassification />} />
        </Routes>
        <Routes>
          <Route index path="/guide" element={<MainContent />} />
        </Routes>
        <Routes>
          <Route index path="/game" element={<TrashCatchGame />} />
        </Routes>
        <Routes>
          <Route index path="/about" element={<About />} />
        </Routes>
        <Routes>
          <Route index path="/contact" element={<Contact />} />
        </Routes>
        <Routes>
          <Route index path="/login" element={<Login />} />
        </Routes>
        <Routes>
          <Route index path="/register" element={<Register />} />
        </Routes>
        <Routes>
          <Route index path="/profile" element={<Profile />} />
        </Routes>
        <Routes>
          <Route index path="/blog" element={<BlogList />} />
        </Routes>
        <Routes>
          <Route index path="/blog/:id" element={<BlogDetail />} />
        </Routes>
        <Routes>
          <Route index path="/blog/create" element={<CreateBlog />} />
        </Routes>
      </App>
    </Router>
  </React.StrictMode>
);
